import React from 'react';

import {
  Container,
  Info,
  InfoText,
  InfoSeparator,
  InfoButton,
  InfoButtonIcon,
  Image,
} from './styles';

const Index: React.FC = () => {
  return (
    <Container>
      <Info>
        <InfoText>Econtre dados do Covid-19 em Sergipe</InfoText>
        <InfoSeparator />
        <Image />
      </Info>
      <InfoButton>
        Ver Dados
        <InfoButtonIcon />
      </InfoButton>
    </Container>
  );
};

export default Index;
